import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';  // Import Routes and Route from react-router-dom
import BookList from './BookListPage';
import MyIssuedBooks from './MyIssuedBooksPage';  // Assuming you have a MyIssuedBooks component
import Login from './login';  // Assuming you have a Login component
import Signup from './signup';  // Assuming you have a Signup component
import HomePage from './homepage';  // Assuming you have a Signup component
import Admin from './admin';  // Assuming you have a Signup component
import MainPage from './mainpage';  // Assuming you have a Signup component
import Navbar from './Navbar';
const App = () => {
  return (
    <Router>

      <Routes>  {/* Wrap all routes inside <Routes> */}
        <Route path="/" element={<MainPage />} />
        <Route path="/booklist" element={<BookList />} />
        <Route path="/myissuedbooks" element={<MyIssuedBooks />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/userpage" element={<HomePage />} />
        <Route path="/adminpage" element={<Admin />} />
      </Routes>
    </Router>
  );
};

export default App;
